import 'bootstrap/dist/css/bootstrap.min.css';
import About from '../src/components/About';
import Mental_Health from './components/Mental_Health';
const routePath = path => `${process.env.PUBLIC_URL + path}`;

const App = () => {
  return (
    <div>
      <About />
      <Mental_Health />
    </div>
  );
};

export default App;
